    rot = [[0, 1, 2, 3, 4, 5, 6], [0, 2, 6, 3, 4, 1, 5], [0, 4, 2, 1, 6, 5, 3], [0, 3, 2, 6, 1, 5, 4], [0, 5, 1, 3, 4, 6, 0]]
    dice = [i for i in range(7)]
    for command in commands:
        dice = [dice[rot[dic[command]][i]] for i in range(7)]
    return dice[1]

